import React from 'react';

const NavBar = () => {
	return (
      <div className="NavBar">
        <ul>
          <li><a href='/'>Home</a></li>
          <li><a href='/'>Projects</a></li>
          <li><a href='Blog.js'>Blog</a></li>
          <li><a href='/'>About</a></li>
          <li><a href='/'>GitHub</a></li>
          <li><a href='/'>LinkedIn</a></li>
        </ul>
      </div>

	);
}

export default NavBar;
